def count_ones(X):
    if X in ones:
        return ones[X]
    if X%2:
        ones[X]=1+count_ones(X//2)
    else:
        ones[X]=count_ones(X//2)
    return ones[X]

def zeros(X):
    import math
    n=int(math.log2(X))+1
    return n-count_ones(X)
    


